Canada
Oorlog / Drama
114 minuten

goed

met Paul Gross, Gil Bellows en Robert Nogier

Op 31 juli 1917 begon het enorme bombardement van de Geallieerde artillerie tijdens de Slag om Passchendaele. Er volgde een 
gigantisch bloedige strijd met meer dan een miljoen slachtoffers aan beide zijden. Gevechtseenheden vanuit het gehele Britse 
rijk werden ingeschakeld. Deze film vertelt het verhaal van de Canadezen die in deze hel terechtkwamen.
